import React from "react"
import {Link, NavLink} from "react-router-dom";


function Header() {
    return (
       <nav className="nav">
        <Link to="/">
                <h1 className="site-title">Coheed And Cambria Song List</h1>
        </Link>
        <div>
            <NavLink exact to="/vaxis">
                    Vaxis II: A Window of the Waking Mind
            </NavLink>
        </div>
        <ul>
            <li> <a href="/vaxis">Vaxis II: A Window of the Waking Mind</a> </li>
            <li> <a href="/color">The Color Before The Sun</a> </li>
            <li> <a href="/secret">In Keeping Secrets</a> </li>
         </ul>
    </nav>
    );
}

export default Header;
